import React, {Component} from 'react';

class Sidebar extends Component {
	state = {};
	render() {
		return (
			<table className="table">
				<tr>
					<td>u</td>
				</tr>
				<tr>
					<td>goodbye</td>
				</tr>
			</table>
		);
	}
}

export default Sidebar;
